  false,\n\t\"url\": null,\n\t\"notes\": \"The Syria Cultural Sites dataset contains
  geographic location (point geometry), name, type, and area name of over 1000 cultural
  heritage sites and museums in Syria compiled by the Cultural Heritage Center, Bureau
  of Educational and Cultural Affairs, U.S. Department of State (http://eca.state.gov/cultural-heritage-center)
  as of Spring 2013. The sites are categorized by type, which include but not limited
  to, archaelogical sites, roman ruins, mosques, schools, churches, cemetaries, and
  towns. The data contained herein is entirely unclassified.nnThis dataset is hosted
  on State GeoNode at http://geonode.state.gov/layers/geonode%3ASyria_CulturalSites_2013May22_HIU_USDoS.\",\n\t\"license_title\":
